import React, { useEffect, useState } from "react";
import s from "./MountainContainer.module.css";

const MountainContainer = ({ peakData }) => {
    const [peaks, setPeaks] = useState([]);

    useEffect(() => {
        setPeaks(peakData);
    })

    return (
        <div>
            Mountain Container
            {peaks.map((peak) => (
                <div className="peakContainer">
                    <h2>{peak.name}</h2>
                </div>
            ))}
        </div>
    )
}

export default MountainContainer;
